  false,\n\t\"url\": null,\n\t\"notes\": \"A Phantom DH2+2 remotely operated vehicle
  (ROV) outfitted with video equipment (and other devices) was deployed from the NOAA
  Ship McAurthurII (AR04-04) in an attempt to document the presence of critical hard
  bottom benthic habitats believed to exist in the waters of the Olympic Coast national
  marine sanctuary (OCNMS). Video data from specific dives falling within the bounds
  of the HMPR-113-2004-01q survey area were reviewed to examine the benthic characteristics
  as a tool for validating sonar imagery.\",\n\t\"license_title\": null,\n\t\"extras\":
